export default function ServiceSelector(props) {
  return (
    <div className="service-selector">
      <ul>
        {props.serviceList.map((service, key) => {
          return (
            <li className={`serivce-selector__item`} key={key}>{service}</li>
          )
        })}
      </ul>
    </div>
  )
};
